function addtoOutput(table,output) {

    //handle the trees entry
    var outTrees = output.trees;
    var inTrees = table.trees;
    if(inTrees !== undefined) {

        //handle the different trees
        for(var treeName in inTrees) {
            var inTree = inTrees[treeName];
            var outTree = outTrees[treeName];
            if(outTree === undefined) {
               outTree = {};
               outTrees[treeName] = outTree
            }

            processTagMap(inTree,outTree);

            // //copy the entries in the tree
            // for(var entryTag in inTree) {
            //     var inEntry = inTree[entryTag];
            //     var outEntry = outTree[entryTag];
            //     if(outEntry === undefined) {
            //         outEntry = {};
