            //         if(outUNiqueEntry === undefined) {
            //             outEntry[entryString] = inUniqueEntry;
            //         }
            //     }
            // }
        }
    }

    //handle the trees entry
    var outNamedKeys = output.named_keys;
    var inNamedKeys = table.named_keys;
    if(inNamedKeys !== undefined) {
        processTagMap(inNamedKeys,outNamedKeys);
    }
}

function processTagMap(inTagMap,outTagMap) {
    //copy the entries in the tree
    for(var entryTag in inTagMap) {
        var inEntry = inTagMap[entryTag];
        var outEntry = outTagMap[entryTag];
        if(outEntry === undefined) {
            outEntry = {};
            outTagMap[entryTag] = outEntry;
        }

        //copy the unique overrides
        for(var entryString in inEntry) {
            var inUniqueEntry = inEntry[entryString];
            var outUniqueEntry = outEntry[entryString];
            if(outUNiqueEntry === undefined) {
                outEntry[entryString] = inUniqueEntry;
            }
        }
    }
}

