var value;
var output = {};

output.trees = {};
for(var treeName in allPresets.trees) {
    var tree = allPresets.trees[treeName];
    outTree = {};
    output.trees[treeName] = outTree;


    for(var path in tree) {
       outTree[path] = getOutputEntry(tree[path]);
    }

    //get the total for different bin counts
    output.trees[treeName + "|INFO"] = analyzeEntries(outTree);

}

output.named_keys = {};
for(var keyName in allPresets.named_keys) {
    var namedKey = allPresets.named_keys[keyName];
    output.named_keys[keyName] = getOutputEntry(namedKey);

    //get the total for different bin counts
    output["named_keys|INFO"] = analyzeEntries(output.named_keys);

}

value = output;
return value;

