function getOutputEntry(entry) {
    var count = 0;
    for(var contentKey in entry) {
        var contentEntry = entry[contentKey];
        count++;
    }
    return count;
}

function analyzeEntries(entryMap) {
    var info = {};
    for(var keyName in entryMap) {
        var counts = entryMap[keyName];
        if(info[counts] === undefined) info[counts] = 1;
        else info[counts] = info[counts] + 1;
    }
    return info;
}
